import React, { useState, useEffect } from 'react';
import { 
  BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer, 
  PieChart, Pie, Cell, ScatterChart, Scatter, LineChart, Line, ZAxis, AreaChart, Area,
  ComposedChart, RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis, Radar
} from 'recharts';
import './ChartsView.css';

const STATUS_COLORS = {
  pass: '#00ff88',
  fail: '#ff4757',
  continue_with_error: '#ffa502',
  unknown: '#8884d8',
};

const STAGE_COLORS = {
  'synthesis': '#7367f0',
  'place': '#28c76f',
  'route': '#ff9f43',
  'timing': '#ea5455',
  'power': '#00cfe8',
  'drc': '#9c8cfc',
  'lvs': '#ff6b6b',
  'lec': '#1e9ff2',
  'unknown': '#6c757d'
};

const ChartsView = ({ data, stats }) => {
  console.log('ChartsView data:', data);
  const [chartType, setChartType] = useState('stage-overview');
  const [selectedStage, setSelectedStage] = useState('all');
  const [timeRange, setTimeRange] = useState('30d');

  // Data processing functions
  const processStageData = () => {
    const stageStats = {};
    data.forEach(row => {
      const stage = (row.stage || 'Unknown').trim().toLowerCase();
      const status = (row.run_status || 'unknown').replace(/\s/g, '').toLowerCase();
      const area = parseFloat(row.area_um2) || 0;
      const utilization = parseFloat(row.utilization) || 0;
      const runtime = parseInt(row.runtime_seconds) || 0;

      if (!stageStats[stage]) {
        stageStats[stage] = {
          stage: stage,
          total: 0,
          pass: 0,
          fail: 0,
          continue_with_error: 0,
          unknown: 0,
          avg_area: 0,
          avg_utilization: 0,
          avg_runtime: 0,
          total_area: 0,
          total_utilization: 0,
          total_runtime: 0,
          count: 0
        };
      }

      stageStats[stage].total += 1;
      stageStats[stage].count += 1;
      stageStats[stage].total_area += area;
      stageStats[stage].total_utilization += utilization;
      stageStats[stage].total_runtime += runtime;

      if (stageStats[stage][status] !== undefined) {
        stageStats[stage][status] += 1;
      } else {
        stageStats[stage].unknown += 1;
      }
    });

    // Calculate averages
    Object.values(stageStats).forEach(stage => {
      if (stage.count > 0) {
        stage.avg_area = stage.total_area / stage.count;
        stage.avg_utilization = stage.total_utilization / stage.count;
        stage.avg_runtime = stage.total_runtime / stage.count;
      }
    });

    return Object.values(stageStats);
  };

  const processTimingData = () => {
    const timingData = data.map(row => ({
      stage: (row.stage || 'Unknown').trim(),
      internal_timing: row.internal_timing || 'N/A',
      interface_timing: row.interface_timing || 'N/A',
      max_tran: row.max_tran_wns_nvp || 'N/A',
      max_cap: row.max_cap_wns_nvp || 'N/A',
      status: (row.run_status || 'unknown').replace(/\s/g, '').toLowerCase(),
      area: parseFloat(row.area_um2) || 0,
      utilization: parseFloat(row.utilization) || 0
    })).filter(d => d.internal_timing !== 'N/A' || d.interface_timing !== 'N/A');

    return timingData;
  };

  const processCongestionData = () => {
    const congestionData = data.map(row => ({
      stage: (row.stage || 'Unknown').trim(),
      congestion: row.congestion_drc_metrics || 'N/A',
      area: parseFloat(row.area_um2) || 0,
      utilization: parseFloat(row.utilization) || 0,
      status: (row.run_status || 'unknown').replace(/\s/g, '').toLowerCase()
    })).filter(d => d.congestion !== 'N/A');

    return congestionData;
  };

  const processAreaUtilizationData = () => {
    return data.map(row => ({
      stage: (row.stage || 'Unknown').trim(),
      area: parseFloat(row.area_um2) || 0,
      utilization: parseFloat(row.utilization) || 0,
      status: (row.run_status || 'unknown').replace(/\s/g, '').toLowerCase(),
      runtime: parseInt(row.runtime_seconds) || 0
    })).filter(d => d.area > 0 && d.utilization > 0);
  };

  const processTimeSeriesData = () => {
    const byDate = {};
    data.forEach(row => {
      let date = row.run_end_time || '';
      if (date.includes('/')) {
        const [d, m, y] = date.split('/');
        date = `${y}-${m.padStart(2, '0')}-${d.padStart(2, '0')}`;
      } else if (date.includes('-')) {
        date = date.split('T')[0];
      }

      if (!byDate[date]) {
        byDate[date] = {
          date,
          runs: 0,
          avg_area: 0,
          avg_utilization: 0,
          avg_runtime: 0,
          total_area: 0,
          total_utilization: 0,
          total_runtime: 0,
          pass: 0,
          fail: 0,
          continue_with_error: 0
        };
      }

      const area = parseFloat(row.area_um2) || 0;
      const utilization = parseFloat(row.utilization) || 0;
      const runtime = parseInt(row.runtime_seconds) || 0;
      const status = (row.run_status || 'unknown').replace(/\s/g, '').toLowerCase();

      byDate[date].runs += 1;
      byDate[date].total_area += area;
      byDate[date].total_utilization += utilization;
      byDate[date].total_runtime += runtime;

      if (byDate[date][status] !== undefined) {
        byDate[date][status] += 1;
      }
    });

    Object.values(byDate).forEach(d => {
      if (d.runs > 0) {
        d.avg_area = d.total_area / d.runs;
        d.avg_utilization = d.total_utilization / d.runs;
        d.avg_runtime = d.total_runtime / d.runs;
      }
    });

    return Object.values(byDate).sort((a, b) => a.date.localeCompare(b.date));
  };

  // Chart renderers
  const renderStageOverview = () => {
    const stageData = processStageData();

    return (
      <div className="chart-grid">
        <div className="chart-container">
          <h3>Stage-wise Status Distribution</h3>
          <ResponsiveContainer width="100%" height={400}>
            <BarChart data={stageData} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="stage" stroke="#fff" />
              <YAxis stroke="#fff" />
              <Tooltip />
              <Legend />
              <Bar dataKey="pass" stackId="a" fill={STATUS_COLORS.pass} name="Pass" />
              <Bar dataKey="fail" stackId="a" fill={STATUS_COLORS.fail} name="Fail" />
              <Bar dataKey="continue_with_error" stackId="a" fill={STATUS_COLORS.continue_with_error} name="Continue with Error" />
              <Bar dataKey="unknown" stackId="a" fill={STATUS_COLORS.unknown} name="Unknown" />
            </BarChart>
          </ResponsiveContainer>
        </div>

        <div className="chart-container">
          <h3>Stage Performance Metrics</h3>
          <ResponsiveContainer width="100%" height={400}>
            <ComposedChart data={stageData} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="stage" stroke="#fff" />
              <YAxis yAxisId="left" stroke="#fff" />
              <YAxis yAxisId="right" orientation="right" stroke="#fff" />
              <Tooltip />
              <Legend />
              <Bar yAxisId="left" dataKey="avg_area" fill="#7367f0" name="Avg Area (um)" />
              <Line yAxisId="right" type="monotone" dataKey="avg_utilization" stroke="#ff9f43" name="Avg Utilization (%)" strokeWidth={3} />
            </ComposedChart>
          </ResponsiveContainer>
        </div>
      </div>
    );
  };

  const renderTimingAnalysis = () => {
    const timingData = processTimingData();

    return (
      <div className="chart-grid">
        <div className="chart-container">
          <h3>Timing vs Area Analysis</h3>
          <ResponsiveContainer width="100%" height={400}>
            <ScatterChart margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="area" name="Area (um)" stroke="#fff" />
              <YAxis dataKey="utilization" name="Utilization (%)" stroke="#fff" />
              <ZAxis range={[100, 400]} />
              <Tooltip cursor={{ strokeDasharray: '3 3' }} />
              <Legend />
              {Object.keys(STATUS_COLORS).map(status => (
                <Scatter
                  key={status}
                  name={status.charAt(0).toUpperCase() + status.slice(1)}
                  data={timingData.filter(d => d.status === status)}
                  fill={STATUS_COLORS[status]}
                />
              ))}
            </ScatterChart>
          </ResponsiveContainer>
        </div>

        <div className="chart-container">
          <h3>Timing Distribution by Stage</h3>
          <ResponsiveContainer width="100%" height={400}>
            <BarChart data={timingData} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="stage" stroke="#fff" />
              <YAxis stroke="#fff" />
              <Tooltip />
              <Legend />
              <Bar dataKey="area" fill="#7367f0" name="Area (um)" />
              <Bar dataKey="utilization" fill="#ff9f43" name="Utilization (%)" />
            </BarChart>
          </ResponsiveContainer>
        </div>
      </div>
    );
  };

  const renderCongestionAnalysis = () => {
    const congestionData = processCongestionData();

    return (
      <div className="chart-grid">
        <div className="chart-container">
          <h3>Congestion vs Utilization</h3>
          <ResponsiveContainer width="100%" height={400}>
            <ScatterChart margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="area" name="Area (um)" stroke="#fff" />
              <YAxis dataKey="utilization" name="Utilization (%)" stroke="#fff" />
              <ZAxis range={[100, 400]} />
              <Tooltip cursor={{ strokeDasharray: '3 3' }} />
              <Legend />
              {Object.keys(STATUS_COLORS).map(status => (
                <Scatter
                  key={status}
                  name={status.charAt(0).toUpperCase() + status.slice(1)}
                  data={congestionData.filter(d => d.status === status)}
                  fill={STATUS_COLORS[status]}
                />
              ))}
            </ScatterChart>
          </ResponsiveContainer>
        </div>

        <div className="chart-container">
          <h3>Congestion Metrics by Stage</h3>
          <ResponsiveContainer width="100%" height={400}>
            <BarChart data={congestionData} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="stage" stroke="#fff" />
              <YAxis stroke="#fff" />
              <Tooltip />
              <Legend />
              <Bar dataKey="area" fill="#ea5455" name="Area (um)" />
              <Bar dataKey="utilization" fill="#00cfe8" name="Utilization (%)" />
            </BarChart>
          </ResponsiveContainer>
        </div>
      </div>
    );
  };

  const renderAreaUtilizationAnalysis = () => {
    const areaData = processAreaUtilizationData();

    return (
      <div className="chart-grid">
        <div className="chart-container">
          <h3>Area vs Utilization Correlation</h3>
          <ResponsiveContainer width="100%" height={400}>
            <ScatterChart margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="area" name="Area (um)" stroke="#fff" />
              <YAxis dataKey="utilization" name="Utilization (%)" stroke="#fff" />
              <ZAxis range={[100, 400]} />
              <Tooltip cursor={{ strokeDasharray: '3 3' }} />
              <Legend />
              {Object.keys(STATUS_COLORS).map(status => (
                <Scatter
                  key={status}
                  name={status.charAt(0).toUpperCase() + status.slice(1)}
                  data={areaData.filter(d => d.status === status)}
                  fill={STATUS_COLORS[status]}
                />
              ))}
            </ScatterChart>
          </ResponsiveContainer>
        </div>

        <div className="chart-container">
          <h3>Area Distribution by Stage</h3>
          <ResponsiveContainer width="100%" height={400}>
            <BarChart data={areaData} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="stage" stroke="#fff" />
              <YAxis stroke="#fff" />
              <Tooltip />
              <Legend />
              <Bar dataKey="area" fill="#28c76f" name="Area (um)" />
              <Bar dataKey="utilization" fill="#ff9f43" name="Utilization (%)" />
            </BarChart>
          </ResponsiveContainer>
        </div>
      </div>
    );
  };

  const renderTimeSeriesAnalysis = () => {
    const timeData = processTimeSeriesData();

    return (
      <div className="chart-grid">
        <div className="chart-container">
          <h3>Time Series - Runs and Performance</h3>
          <ResponsiveContainer width="100%" height={400}>
            <ComposedChart data={timeData} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="date" stroke="#fff" />
              <YAxis yAxisId="left" stroke="#fff" />
              <YAxis yAxisId="right" orientation="right" stroke="#fff" />
              <Tooltip />
              <Legend />
              <Bar yAxisId="left" dataKey="runs" fill="#7367f0" name="Runs" />
              <Line yAxisId="right" type="monotone" dataKey="avg_area" stroke="#28c76f" name="Avg Area (um)" strokeWidth={3} />
              <Line yAxisId="right" type="monotone" dataKey="avg_utilization" stroke="#ff9f43" name="Avg Utilization (%)" strokeWidth={3} />
            </ComposedChart>
          </ResponsiveContainer>
        </div>

        <div className="chart-container">
          <h3>Status Trend Over Time</h3>
          <ResponsiveContainer width="100%" height={400}>
            <AreaChart data={timeData} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="date" stroke="#fff" />
              <YAxis stroke="#fff" />
              <Tooltip />
              <Legend />
              <Area type="monotone" dataKey="pass" stackId="1" stroke={STATUS_COLORS.pass} fill={STATUS_COLORS.pass} name="Pass" />
              <Area type="monotone" dataKey="fail" stackId="1" stroke={STATUS_COLORS.fail} fill={STATUS_COLORS.fail} name="Fail" />
              <Area type="monotone" dataKey="continue_with_error" stackId="1" stroke={STATUS_COLORS.continue_with_error} fill={STATUS_COLORS.continue_with_error} name="Continue with Error" />
            </AreaChart>
          </ResponsiveContainer>
        </div>
      </div>
    );
  };

  const renderRadarAnalysis = () => {
    const stageData = processStageData();

    return (
      <div className="chart-grid">
        <div className="chart-container">
          <h3>Stage Performance Radar</h3>
          <ResponsiveContainer width="100%" height={400}>
            <RadarChart data={stageData} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <PolarGrid />
              <PolarAngleAxis dataKey="stage" />
              <PolarRadiusAxis />
              <Radar name="Avg Area" dataKey="avg_area" stroke="#7367f0" fill="#7367f0" fillOpacity={0.3} />
              <Radar name="Avg Utilization" dataKey="avg_utilization" stroke="#ff9f43" fill="#ff9f43" fillOpacity={0.3} />
              <Radar name="Avg Runtime" dataKey="avg_runtime" stroke="#28c76f" fill="#28c76f" fillOpacity={0.3} />
              <Legend />
            </RadarChart>
          </ResponsiveContainer>
        </div>

        <div className="chart-container">
          <h3>Status Distribution Pie</h3>
          <ResponsiveContainer width="100%" height={400}>
            <PieChart>
              <Pie
                data={Object.entries(STATUS_COLORS).map(([status, color]) => ({
                  name: status.charAt(0).toUpperCase() + status.slice(1),
                  value: data.filter(row => (row.run_status || 'unknown').replace(/\s/g, '').toLowerCase() === status).length,
                  color
                }))}
                dataKey="value"
                nameKey="name"
                cx="50%"
                cy="50%"
                outerRadius={120}
                label={({ name, percent }) => `${name} ${(percent * 100).toFixed(0)}%`}
              >
                {Object.entries(STATUS_COLORS).map(([status, color], index) => (
                  <Cell key={`cell-${index}`} fill={color} stroke="#fff" strokeWidth={2} />
                ))}
              </Pie>
              <Tooltip />
              <Legend />
            </PieChart>
          </ResponsiveContainer>
        </div>
      </div>
    );
  };

  const renderChart = () => {
    switch (chartType) {
      case 'stage-overview':
        return renderStageOverview();
      case 'timing-analysis':
        return renderTimingAnalysis();
      case 'congestion-analysis':
        return renderCongestionAnalysis();
      case 'area-utilization':
        return renderAreaUtilizationAnalysis();
      case 'time-series':
        return renderTimeSeriesAnalysis();
      case 'radar-analysis':
        return renderRadarAnalysis();
      default:
        return renderStageOverview();
    }
  };

  return (
    <div className="charts-view">
      <div className="charts-header">
        <div className="header-content">
          <h2> Advanced Data Analytics</h2>
          <p>Comprehensive analysis of stages, timing, congestion, and performance metrics</p>
        </div>

        <div className="chart-controls">
          <button 
            className={chartType === 'stage-overview' ? 'active' : ''} 
            onClick={() => setChartType('stage-overview')}
          >
            Stage Overview
          </button>
          <button 
            className={chartType === 'timing-analysis' ? 'active' : ''} 
            onClick={() => setChartType('timing-analysis')}
          >
            Timing Analysis
          </button>
          <button 
            className={chartType === 'congestion-analysis' ? 'active' : ''} 
            onClick={() => setChartType('congestion-analysis')}
          >
            Congestion Analysis
          </button>
          <button 
            className={chartType === 'area-utilization' ? 'active' : ''} 
            onClick={() => setChartType('area-utilization')}
          >
            Area & Utilization
          </button>
          <button 
            className={chartType === 'time-series' ? 'active' : ''} 
            onClick={() => setChartType('time-series')}
          >
            Time Series
          </button>
          <button 
            className={chartType === 'radar-analysis' ? 'active' : ''} 
            onClick={() => setChartType('radar-analysis')}
          >
            Radar Analysis
          </button>
        </div>
      </div>

      {data && data.length > 0 && (
        <div className="charts-summary">
          <div className="summary-card">
            <h4>Total Runs</h4>
            <div className="summary-value">{data.length}</div>
          </div>
          <div className="summary-card">
            <h4>Stages</h4>
            <div className="summary-value">{new Set(data.map(row => row.stage)).size}</div>
          </div>
          <div className="summary-card">
            <h4>Success Rate</h4>
            <div className="summary-value">
              {((data.filter(row => (row.run_status || '').toLowerCase() === 'pass').length / data.length) * 100).toFixed(1)}%
            </div>
          </div>
          <div className="summary-card">
            <h4>Avg Area</h4>
            <div className="summary-value">
              {(data.reduce((sum, row) => sum + (parseFloat(row.area_um2) || 0), 0) / data.length).toFixed(2)} um
            </div>
          </div>
        </div>
      )}

      <div className="charts-content">
        {data && data.length > 0 ? (
          renderChart()
        ) : (
          <div className="no-data">
            <div className="no-data-icon"></div>
            <h3>No Data Available</h3>
            <p>Please load some data to view the charts</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default ChartsView;
